  \"2015-09-17T04:47:15.651925\",\n\t\"name\": \"greenhouse-gas-emissions-estimates\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"The State conducted a detailed inventory
  of greenhouse gasses in 2006 and 2011. The 2014 detailed inventory will be released
  at the end of 2015.  Estimated actual emissions for those two years represent the
  results of these inventories.  rnrnProjected emissions under a \"business as usual\"
  scenario were estimated based on the 2006 inventory, projected forward using a protocol
  set forth by the Environmental Protection Agency.  The business as usual estimates
  were revised due to changes in the economy since the protocol was set out.  It is
  important to bear in mind that a BAU projected emissions inventory is a forecast
  that may, or may not, prove to be an entirely accurate predictor of future emissions.
  rnrnAnnual actual emission estimates were calculated for the intervening years from
  2006 through 2011 by utilizing three surrogates as indicators of emissions (energy,
  transportation and residential, commercial and industrial fuel combustion).  These
  three sectors account for over 85 percent of greenhouse gas emissions in Maryland.\",\n\t\"license_title\":
